      SELECT ALL - col1, - 46 * - col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN - + col1 / + col2 - + 75 AND - - col2;
  - name: tab1

outputs:
